For sale is a CW45 with less than 250 rounds fired.  Kahr recommends a break-in period of 200 rounds.  Included are:
Original box/paperwork
2 magazines (CW series only includes 1 mag from the factory)
2 leather IWB holsters - one is a summer comfort style and the other is a High Noon clip-on style with FBI-cant.

$425 or trade toward a Smith & Wesson 586, 686 or Model 19, etc. .357 revolver; CZ75 or EAA Witness; 
Glock 20SF / 29SF 10mm; 
Remington 1100;
Savage Hog hunter .308.  
Let me know what you have.
